Adding the push constants to a shader is pretty easy, but there are few rules. All of your push constants appear in a single block with the special layout value of push_constant . This block isn't in or out , instead it's uniform . After that you give a name for the block type, the block itself, and then the name that we're going to access it under. If you haven't programmed in C before this, it may seem weird, but they think it's normal. We just have to go with it. Since we want a single f32 to be the time, we define it as a block that holds a single float value (the GLSL equivalent) which we call time . Then we take push.time (think of it like they're all stored within a global push struct), do some funny math on that so that it ends up as a 0.0 to 1.0 value (since color channels are supposed to be in that range), and make a vec4. We can multiply the vec4 from our time with the vec4 for our frag_color , and it does a component-wise multiplication (a.x * b.x, a.y * b.y, etc). Then we shove the result out the door. Bam, now our triangle shifts between black and rainbow. pub const FRAGMENT_SOURCE: &str = "#version 450
layout (push_constant) uniform PushConsts { float time;
} push; layout (location = 1) in vec3 frag_color; layout (location = 0) out vec4 color; void main()
{ float time01 = -0.9 * abs(sin(push.time * 0.9)) + 0.9; color = vec4(frag_color,1.0) * vec4(time01,time01,time01,1.0);
}";

