pub struct Quad { pub x: f32, pub y: f32, pub w: f32, pub h: f32,
} So if we have four "real" points, and we want to make two triangles... well we need 3 points per triangle... We could just list out some of the points more than once (scrub mode) or we could get fancy in how we tell the GPU to do it and kick it up to a technique called "Indexed Drawing" (cool mode). The details of that will be covered in a moment, right now we need to have a method to turn a quad into some vertex data. impl Quad { pub fn vertex_attributes(self) -> [f32; 4 * (2 + 3 + 2)] { let x = self.x; let y = self.y; let w = self.w; let h = self.h; #[cfg_attr(rustfmt, rustfmt_skip)] [ // X Y R G B U V x , y+h, 1.0, 0.0, 0.0, /* red */ 0.0, 1.0, /* bottom left */ x , y , 0.0, 1.0, 0.0, /* green */ 0.0, 0.0, /* top left */ x+w, y , 0.0, 0.0, 1.0, /* blue */ 1.0, 0.0, /* bottom right */ x+w, y+h, 1.0, 0.0, 1.0, /* magenta */ 1.0, 1.0, /* top right */ ] }
} As you can see, we're approaching the limit of being able to specify it all as a flat array. In future lessons we'll talk about having a proper Vertex type and giving it fields so that it's easier to tell what parts are what and such. For a single quad it's probably okay to do it like this. So each vertex will have an XY position like before, and an RGB color like before, and now we're adding a UV texture coordinate as well. We'll also have to change around our pipeline setup to allow for the new vertex attribute. Texture positions are always stored as 0.0 to 1.0 within the texture, U goes horizontal (like X) and V is vertical (like Y). Within gfx-hal , the (0.0, 0.0) position for UV coordinates is the top left corner of the image. Even if the backend would normally use some other system, gfx-hal does the translations necessary so that (0.0, 0.0) is the top left. Note that some other graphics systems (mostly OpenGL) put the texture origin at the bottom left instead! If you're trying out some shader code samples from some other place and your images come out unexpectedly upside down, that's why. You can compensate by flipping the image data before you upload it (I'll mention that in a moment), or you can flip the computed coordinate before looking up the data in the texture by using 1.0-V instead of using V directly.

