First of all, now that we're having more than one buffer, we want to take that buffer creation (declare buffer, check requirements, get memory, bind memory) and pack it into its own thing. We'll call it a BufferBundle , because that seems like a good enough name for a really generic sort of thing that we don't even fully know how we'll use in the future. The struct for it is very simple. We can even make it generic over the Backend trait for maximum angle brackets in our code. (Rust is always better with more angle brackets in the types, right?) pub struct BufferBundle<B: Backend, D: Device<B>> { pub buffer: ManuallyDrop<B::Buffer>, pub requirements: Requirements, pub memory: ManuallyDrop<B::Memory>, pub phantom: PhantomData<D>,
} We'll make all the fields be pub , because (hot take) that's honestly the better default for fields, unless you're trying to maintain some invariants with the type. The BufferBundle isn't smart enough to have any invariants. So we've got it generic over Backend , and then our methods will be using a particular Device , and it'd be slightly insane to try and use a buffer between two different device implementations, so we'll throw in a ðŸ‘» PhantomData ðŸ‘» so that things know we had a particular device in mind when we made the buffer. Is there anything that PhantomData can't solve? I sure hope not. ðŸ‘» Do we want this type to have any methods? Yeah, obviously, we want to be able to make new ones. We'll just cut that code for making the vertex buffer and then make it a little more buffer agnostic and reusable. impl<B: Backend, D: Device<B>> BufferBundle<B, D> { pub fn new(adapter: &Adapter<B>, device: &D, size: usize, usage: BufferUsage) -> Result<Self, &'static str> { unsafe { let mut buffer = device .create_buffer(size as u64, usage) .map_err(|_| "Couldn't create a buffer!")?; let requirements = device.get_buffer_requirements(&buffer); let memory_type_id = adapter .physical_device .memory_properties() .memory_types .iter() .enumerate() .find(|&(id, memory_type)| { requirements.type_mask & (1 << id) != 0 && memory_type.properties.contains(Properties::CPU_VISIBLE) }) .map(|(id, _)| MemoryTypeId(id)) .ok_or("Couldn't find a memory type to support the buffer!")?; let memory = device .allocate_memory(memory_type_id, requirements.size) .map_err(|_| "Couldn't allocate buffer memory!")?; device .bind_buffer_memory(&memory, 0, &mut buffer) .map_err(|_| "Couldn't bind the buffer memory!")?; Ok(Self { buffer: ManuallyDrop::new(buffer), requirements, memory: ManuallyDrop::new(memory), phantom: PhantomData, }) } } Note: In a program with many buffers you wouldn't want each buffer to be its own memory allocation, because devices have a limit on the number of allocations as well as on the total amount of allocated memory. However, implementing a proper memory allocator is obviously way out of scope for right now, so we'll just do the beginner thing. Also we want to be able to throw them away when we're done. Question: Do we want it to be Drop ? Mmmm, no. But HalState is Drop , why not this too? Well, HalState gets to be Drop because it's holding the Device field that's needed to destroy all the other stuff it has. A BufferBundle has a PhantomData for a device thing, but it isn't holding an actual Device , so it can't perform a Drop on its own. Should it hold an actual device reference? I think not. That'd make it really hard to store in our HalState alongside the device field. The lifetimes would go crazy. So we'll just make a method to manually_drop the type, and then it'll do the thing. pub unsafe fn manually_drop(&self, device: &D) { use core::ptr::read; device.destroy_buffer(ManuallyDrop::into_inner(read(&self.buffer))); device.free_memory(ManuallyDrop::into_inner(read(&self.memory))); }
}

