LAST STEP! In the fragment shader we need to declare that we'll be getting this image data: layout(set = 0, binding = 0) uniform texture2D tex;
layout(set = 0, binding = 1) uniform sampler samp; Notice the binding s here match up with what we put all the way back in our DescriptorSetLayout . The set value is matched up with the position of the DescriptorSet within the IntoIterator that we passed to bind_graphics_descriptor_sets . Then in main we form a sampler2D from the texture2D and sampler put together. This lets us call the texture function, passing the sampler2D as well as the UV coordinates of that fragment. That finally ets us a RGBA color out of the texture data. We could output this directly, but just for fun (and to show off a little more of what a fragment shader can do) we'll use the time value to shift between the texture data and the rainbow color data. This is a snap to do with the mix function. It takes two colors, and a portion (from 0.0 to 1.0) for how much the second color should determine the output (it's just a linear interpolation, if you remember that from the sampler stuff above). We'll cover this in more detail later on. For now it's okay to just know that it works. #version 450
layout (push_constant) uniform PushConsts { float time;
} push; layout(set = 0, binding = 0) uniform texture2D tex;
layout(set = 0, binding = 1) uniform sampler samp; layout (location = 1) in vec3 frag_color;
layout (location = 2) in vec2 frag_uv; layout (location = 0) out vec4 color; void main()
{ float time01 = -0.9 * abs(sin(push.time * 0.7)) + 0.9; vec4 tex_color = texture(sampler2D(tex, samp), frag_uv); color = mix(tex_color, vec4(frag_color, 1.0), time01);
} And we're finally through! textures-complete

