Now we update LocalState to track the spare time we had from last time: #[derive(Debug, Clone, Default)]
pub struct LocalState { pub frame_width: f64, pub frame_height: f64, pub mouse_x: f64, pub mouse_y: f64, pub cubes: Vec<glm::TMat4<f32>>, pub spare_time: f32,
} And every frame when we update, we'll use 1/60th of a second of time if it's available. This makes the physics work as smoothly as possible. Of course, in a full program you'd need some more checks before you blindly perform however many physics frames all at once. If the system clock goes backwards maybe skip doing physics that frame. If the system clock jumps forward too many frames at once maybe cap out at some handful and discard the rest. And ideally you'd need to make sure that your computation time per frame is on average less than the actual time otherwise your leftover time would grow forever and the system would chug slower and slower. Time has a lot of fiddly bits to get right if you want to be robust about it. impl LocalState { pub fn update_from_input(&mut self, input: UserInput) { if let Some(frame_size) = input.new_frame_size { self.frame_width = frame_size.0; self.frame_height = frame_size.1; } if let Some(position) = input.new_mouse_position { self.mouse_x = position.0; self.mouse_y = position.1; } assert!(self.frame_width != 0.0 && self.frame_height != 0.0); let x_axis = (self.mouse_x / self.frame_width) as f32; let y_axis = (self.mouse_y / self.frame_height) as f32; self.spare_time += input.seconds; const ONE_SIXTIETH: f32 = 1.0 / 60.0; while self.spare_time > 0.0 { for (i, cube_mut) in self.cubes.iter_mut().enumerate() { let r = ONE_SIXTIETH * 30.0 * (i as f32 + 1.0); *cube_mut = glm::rotate( &cube_mut, f32::to_radians(r), // if you change z to 0.0 you need to assert that x_axis and y_axis // don't also end up as 0.0, otherwise you'll get NaN when you // normalize and then you'll get NaN in your matrix and then nothing // will display. &glm::make_vec3(&[x_axis, y_axis, 0.3]).normalize(), ); } self.spare_time -= ONE_SIXTIETH; } }
} As to the actual "physics" we're doing, we'll just rotate the cubes some. Since I still want a little interaction, so we'll have the mouse position control the angle of rotation. And now we got spinny boxes! coordinates-complete As always, full code is available in the examples directory .

