} We've got a little extra note there in the names that the pitch and yaw will be in degrees, because degrees are usually easier for a human to think about, but the sin and cos functions are for radians , so when we eventually call those we'll need a conversion first. Now we declare the "up" vector, which is always the same for this particular camera. We need it for moving the camera and also for creating the look_at view matrix. Unfortunately, I'm not seeing a const function for making a TVec3 value, so we'll declare the array as a const and then just convert it into a TVec3 when we need to. impl EulerCamera { const UP: [f32; 3] = [0.0, 1.0, 0.0]; Next we want a "front" or "forward" vector. This is a vector that points forward out of the camera into the world. We're actually tracking our pitch and yaw as angles, but we'll need the front vector for doing movement and computing the look_at matrix. This involves some sin and cos calls, so we have to convert our degree values into radian values. If we wanted we could cache this vector along side our angle values, but that's not really necessary (you probably only touch your camera once per frame) so we'll keep it simple and just build the vector from scratch each time. fn make_front(&self) -> glm::TVec3<f32> { let pitch_rad = f32::to_radians(self.pitch_deg); let yaw_rad = f32::to_radians(self.yaw_deg); glm::make_vec3(&[ yaw_rad.sin() * pitch_rad.cos(), pitch_rad.sin(), yaw_rad.cos() * pitch_rad.cos(), ]) } Orientation updates are pretty simple, but we have to be mindful of the limits we talked about. We'll cap pitch at +/- 89 degrees, and we'll make sure that the yaw value gets wrapped to being within +/- 360.0 degrees. Remember that floats are more accurate the closer they are to zero, and we don't want any weird accuracy problems creeping up on us. pub fn update_orientation(&mut self, d_pitch_deg: f32, d_yaw_deg: f32) { self.pitch_deg = (self.pitch_deg + d_pitch_deg).max(-89.0).min(89.0); self.yaw_deg = (self.yaw_deg + d_yaw_deg) % 360.0; } Now we need a way to update the position of the camera. First of all, you can just assign the camera any new position at any time and it'll work right. However, we also want to support going "forward" and "sideways" relative to the current perspective (like you do in a first person game), so we'll want a method for that. We take in which keys are being held down and then how far the camera should move in whatever direction the keys determine. The distance moved is camera_speed * time_elapsed, but whoever calls update_position can just compute that on their side before they call us. The way that this works is that we first gather up all the deltas that the keys are trying to get us to do. If that total is zero we didn't move so we're done. If it's non-zero we first have to normalize the direction vector. If we didn't normalize our direction vector then moving forward or sideways would be "1" unit of distance but moving forward and sideways would end up being "1.4" (technically sqrt(2) ) units of distance ( Pythagorean theorem , yo). It's pretty silly for diagonal movement to be faster than direct movement, and even professional games such as Morrowind and Obduction make this easy mistake. Once we have our normalized direction vector, we scale the vector by our distance value and add it to our position. pub fn update_position(&mut self, keys: &HashSet<VirtualKeyCode>, distance: f32) { let up = glm::make_vec3(&Self::UP); let forward = self.make_front(); let cross_normalized = glm::cross::<f32, glm::U3>(&forward, &up).normalize(); let mut move_vector = keys .iter() .fold(glm::make_vec3(&[0.0, 0.0, 0.0]), |vec, key| match *key { VirtualKeyCode::W => vec + forward, VirtualKeyCode::S => vec - forward, VirtualKeyCode::A => vec + cross_normalized, VirtualKeyCode::D => vec - cross_normalized, VirtualKeyCode::E => vec + up, VirtualKeyCode::Q => vec - up, _ => vec, }); if move_vector != glm::zero() { move_vector = move_vector.normalize(); self.position += move_vector * distance; } } I've implemented it as a "flying" style camera here. It uses the front vector for movement, so if you look up while going forward then you also move up (depending on pitch). I've also set Q and E to shift the camera directly up and down. If that's not appropriate for your own program then you'd want to compute a forward vector with just X and Z changes based on yaw alone. What you'd probably actually want is to directly place the camera within the location given to you by some physics object as it moves through the simulation, and just let the physics system handle all the position updates. Just assigning to the position field directly is fine, that's why it's pub . (Note, the A and D math is sensitive to the fact that the projection matrix is flipping Y values after they pass through the View matrix. In other words, if you port this code to OpenGL where Y is up naturally then you'll need to flip which one is + and which one is - , otherwise you'll move left/right flipped). Finally, now that we can adjust the details on our camera, we just need to ask it to please give us the correct view matrix. pub fn make_view_matrix(&self) -> glm::TMat4<f32> { glm::look_at_lh( &self.position, &(self.position + self.make_front()), &glm::make_vec3(&Self::UP), ) } Oh, and it needs at least one constructor because of those private fields. Let's give it a const constructor for being at a particular position. Always nice to have a const constructor if you can manage it. pub const fn at_position(position: glm::TVec3<f32>) -> Self { Self { position, pitch_deg: 0.0, yaw_deg: 0.0, } }

