Now that we've got this nice camera we can replace out view matrix field with a camera field. #[derive(Debug, Clone)]
pub struct LocalState { pub frame_width: f64, pub frame_height: f64, pub mouse_x: f64, pub mouse_y: f64, pub cubes: Vec<glm::TMat4<f32>>, pub camera: EulerCamera, pub perspective_projection: glm::TMat4<f32>, pub orthographic_projection: glm::TMat4<f32>, pub is_orthographic: bool, pub spare_time: f32,
} And in the LocalState initializer we need to place the camera at the same position as before. camera: EulerCamera::at_position(glm::make_vec3(&[0.0, 0.0, -5.0])), which means that do_the_render needs a minor update to get a view matrix in the new way. fn do_the_render(hal_state: &mut HalState, local_state: &LocalState) -> Result<(), &'static str> { let projection = if local_state.is_orthographic { local_state.orthographic_projection } else { local_state.perspective_projection }; let view_projection = projection * local_state.camera.make_view_matrix(); hal_state.draw_cubes_frame(&view_projection, &local_state.cubes)
} That finally brings us to LocalState::update_from_input . This part is a little bit of a pickle. We're updating our "physics" by 1/60th of a second every 1/60th of a second. However, we're accepting input faster than that in some cases (if Mailbox mode is selected). Does the camera count as part of our physics? Can we do some updates to it faster than 60fps and then others at only 60fps? Should we buffer all updates until the next physics frame and only do them exactly when the rest of the physics happens? Well, unfortunately that's an answer you'll need to sort out for yourself. Our camera isn't really connected to anything, but if your camera is connected to an actual physics entity (like a player entity) then you'd probably need to buffer up the inputs that come in faster than 60fps, do your physics at the right time, and then update your camera only in response to the physics simulation result. Or you could not even use Mailbox mode if you don't want to worry about it possibly being there and possibly not being there. For our example, I'll have the camera code be disjoint from the physics code just to see how it would be done if you wanted to do it that way. // do camera updates distinctly from physics, based on this frame's time const MOUSE_SENSITIVITY: f32 = 0.05; let d_pitch_deg = input.orientation_change.1 * MOUSE_SENSITIVITY; let d_yaw_deg = -input.orientation_change.0 * MOUSE_SENSITIVITY; self.camera.update_orientation(d_pitch_deg, d_yaw_deg); self .camera .update_position(&input.keys_held, 5.0 * input.seconds);

