omething you can evade. Event::DeviceEvent { event: DeviceEvent::Key(KeyboardInput { virtual_keycode: Some(code), state, .. }), .. } => drop(match state { ElementState::Pressed => keys_held.insert(code), ElementState::Released => keys_held.remove(&code), }), That would be the end of it, but macOS doesn't provide keys as device events. So we need to handle keys as window events too. Also, even on non-mac there's a few window event keys that we want to respond do. We're keeping "tab swaps the projection", and also we're adding "escape undoes the grab". // We want to respond to some of the keys specially when they're also // window events too (meaning that the window was focused when the event // happened). Event::WindowEvent { event: WindowEvent::KeyboardInput { input: KeyboardInput { state, virtual_keycode: Some(code), .. }, .. }, .. } => { #[cfg(feature = "metal")] { match state { ElementState::Pressed => keys_held.insert(code), ElementState::Released => keys_held.remove(&code), } }; if state == ElementState::Pressed { match code { VirtualKeyCode::Tab => output.swap_projection = !output.swap_projection, VirtualKeyCode::Escape => { if *grabbed { debug!("Escape pressed while grabbed, releasing the mouse!"); window .grab_cursor(false) .expect("Failed to release the mouse grab!"); window.hide_cursor(false); *grabbed = false; } } _ => (), } } } We also want to use DeviceEvent to track mouse motion. The difference between this and the CursorMoved event from before is that WindowEvent::CursorMoved gives the position within the window , while DeviceEvent::MouseMotion gives the mouse's position delta . We're going to "grab" the mouse to lock it within the window. When the mouse goes all the way to left and hits x=0 we'd stop getting CursorMoved events, but we want to keep turning the view as long as the user keeps turning the mouse. By using MouseMotion events we can track the mouse's intended movement even while the cursor is grabbed. Also, this is the part where you'd inve