} Hmm, but the submit method had extra bounds in there: T: 'a + Submittable<B, C, Primary>, Ic: IntoIterator<Item = &'a T>, S: 'a + Borrow<B::Semaphore>, Iw: IntoIterator<Item = (&'a S, PipelineStage)>, Is: IntoIterator<Item = &'a S>, So if we put that together, and allow ourselves to use some slightly fake Rust syntax for just a moment, we need to build this: pub struct Submission { pub command_buffers: IntoIterator<Item = &'a Submittable<B, C, Primary>>, pub wait_semaphores: IntoIterator<Item = (&'a Borrow<B::Semaphore>, PipelineStage)>, pub signal_semaphores: IntoIterator<Item = &'a Borrow<B::Semaphore>>,
} command_buffers is our Submittable things, which are Borrow<B::CommandBuffer> , so we can think of that as being sorta like &[CommandBuffer] . wait_semaphores gives the semaphores that this submission has to wait on before it starts . Each semaphore is paired with a PipelineStage , allowing your submission to wait for a stage, do some work at that stage, wait for another stage, do some more work at the new stage, and so on. signal_semaphores gives a list of semaphores that this submission will signal once it completes . It doesn't say, but I'm guessing that all the semaphores just get signaled at once at the end of the Submission. All of this is basically what you find in the VkSubmitInfo struct.

