So we need to fill up a CommandBuffer with the operations that we want to have happen during the draw process. All we want to do is clear the screen, that's got to be easy enough. Well, it turns out that a CommandBuffer isn't totally free to make, so we want to make them ahead of time and then pick out and use a particular command buffer each frame. That's easy, we can change our Submission declaration very easily. Also, before it's part of the Submission, we want to grab a &mut to the particular command buffer and write to it. That calls for the ever-lovable "inner scope" so that the &mut goes away and we can take a & to our buffer instead. Thankfully (I guess), recording to a CommandBuffer is all unsafe, so we can kill two birds with one stone. A CommandBuffer is actually wrapping around a RawCommandBuffer with some metadata for bonus type safety. All the real documentation is given on the RawCommandBuffer type. Unfortunately, the methods aren't exactly the same name. Hopefully that's fixed in 0.2. We start by calling begin pub unsafe fn begin(&mut self, allow_pending_resubmit: bool) To begin the buffer overall. Then we start a particular render pass with pub unsafe fn begin_render_pass_inline<T>( &mut self, render_pass: &B::RenderPass, frame_buffer: &B::Framebuffer, render_area: Rect, clear_values: T
) -> RenderPassInlineEncoder<B>
where T: IntoIterator, T::Item: Borrow<ClearValue>, Which records a render pass with no secondary command buffers. Next we... immediately finish the render pass. The RenderPass struct will define how to deal with the color buffer, including the clear effect, and the ClearValue just picks what color to clear to. Note: images can have more than just color data, so we have to put the "clear to this color" part into an iterator. In more advanced code you'd specify the clear color and also the clear depth value (they're both part of the ClearValue enum). We're not using the depth buffer at the moment, so it's just a 1 element array. After that, we're already done. pub fn draw_clear_frame(&mut self, color: [f32; 4]) -> Result<(), &str> { // SETUP FOR THIS FRAME // ... // RECORD SOME COMMANDS { let buffer = &mut self.command_buffers[i_usize]; let clear_values = [ClearValue::Color(ClearColor::Float(color))]; buffer.begin(false); buffer.begin_render_pass_inline( &self.render_pass, &self.swapchain_framebuffers[i_usize], self.render_area, clear_values.iter(), ); buffer.finish(); } // SUBMISSION // ... }

