Once the window is open the user will try to interact with the window. They'll move the mouse, type keys, click the x in the corner to close it, things like that. You handle all of this with EventsLoop . You can call run_forever with a callback, or poll_events with a callback. In both cases, your callback gets an Event , which is an enum. Naturally we have to match on that and find the cases we care about. We can discard the other types. You'll actually get a whole lot of events through winit , so it's definitely good to ignore most of them if you only care about one or two event types. let mut running = true;
while running { events_loop.poll_events(|event| match event { Event::WindowEvent { event: WindowEvent::CloseRequested, .. } => running = false, _ => (), });
}

