We'll have a lot of things floating around as we go along, so we'll want to pack things together when we can. Winit doesn't care what graphical libs you're using to draw within the frame, so we can keep just the windowing stuff in its own struct, apart from any gfx-hal things. #[derive(Debug)]
pub struct WinitState { pub events_loop: EventsLoop, pub window: Window,
} Of course, we want to streamline those building steps: impl WinitState { /// Constructs a new `EventsLoop` and `Window` pair. /// /// The specified title and size are used, other elements are default. /// ## Failure /// It's possible for the window creation to fail. This is unlikely. pub fn new<T: Into<String>>(title: T, size: LogicalSize) -> Result<Self, CreationError> { let events_loop = EventsLoop::new(); let output = WindowBuilder::new() .with_title(title) .with_dimensions(size) .build(&events_loop); output.map(|window| Self { events_loop, window, }) }
} And we probably want to go one step farther for our examples and just give a Default impl that calls new with some default values and then panics if there's a CreationError . pub const WINDOW_NAME: &str = "Hello Winit"; impl Default for WinitState { /// Makes an 800x600 window with the `WINDOW_NAME` value as the title. /// ## Panics /// If a `CreationError` occurs. fn default() -> Self { Self::new( WINDOW_NAME, LogicalSize { width: 800.0, height: 600.0, }, ) .expect("Could not create a window!") }
}

