Once again, even baby steps in functionality will demand pages and pages of work to get arranged properly. What we're going to write in this lesson is a single public method so that we can draw a single triangle as a displayed frame. For now we'll stick to just one triangle (three points), and even then, only a 2D triangle of (x,y) points. #[derive(Debug, Clone, Copy)]
pub struct Triangle { pub points: [[f32; 2]; 3],
}
impl Triangle { pub fn points_flat(self) -> [f32; 6] { let [[a, b], [c, d], [e, f]] = self.points; [a, b, c, d, e, f] }
} Why only 2D? Unfortunately, without the help of camera perspective, lightning, shading, and other effects like that, 3D things just don't show up very well on a 2D screen. Instead of looking like a normal triangle at an angle, it just looks like a slightly differently shaped triangle, but still totally flat. So when we finally transmit the triangle to the GPU we'll simply give all three points an identical z coordinate for now. To have some sort of confirmation of input and output like before we'll have one of the triangle points follow the user's mouse movements. Nothing fancy, just a way to see that we're continually drawing a new thing each time. Actually passing in the triangle to draw is basically identical to the clear color function: impl HalState { pub fn draw_triangle_frame(&mut self, triangle: Triangle) -> Result<(), &'static str> { unimplemented!() }
} The ability to draw exactly one triangle isn't very useful on its own. What I mean is that we could potentially use the draw_clear_frame method in the future even in a "complete program". We could use it during a brief loading screen or something. However, draw_triangle_frame doesn't really have a good shelf life. In a complete program we'd want to have a way to specify an entire scene of models, each composed of many triangles. In fact, if properly supporting draw_triangle_frame in future lessons gives us any trouble at all, we'll just delete it instead. It's seriously that impractical. Why add a thing only to then take it away? Because demanding of ourselves to draw a single triangle, of any quality, forces us to put in to place many more parts of our overall "rendering pipeline". The rendering pipeline is what's really here to stay. A complete rendering pipeline with all the bells and whistles is even more complex than a complete Swapchain like we did last time. It's a many lesson long process to fully understand. In fact, the Swapchain is one portion of the overall rendering pipeline. So we saw a bit of the whole picture in the last lesson, we'll add more this lesson, and we'll keep expanding and refining our process in each future lesson. The entire field of 3D programming is just an unending process of learning more and more about how you can twist the rendering pipeline to do exactly what you want, when you want, as fast as possible. If that concept doesn't excite and interest you, best to get out now. No shame in wanting to code other parts of a program instead, but that's really all we'll be doing, so save yourself the time if that's not what you care about.

