First we update our shaders to use the new color attribute. A full color output is of course RGBA (vec4), but as input we'll just give RGB and then let the fragment shader add that A=1.0 in its output. So our input locations are 0 (position) and 1 (color), and our output locations are also 0 (the magical gl_Position) and 1 (frag_color for the fragment shader). The fact that the position information is location 0 for both inputs and outputs isn't special, you could swap it around if you wanted. Like with the previous lesson, our fragment shader just promotes the 2D input into a flat 3D output (which is actually a vec4 , and I'll get to why that is in the lesson on coordinate spaces). The other line of main , saying frag_color = color; might look a little silly, but there's a lot of magic wrapped up in that shorthand. It's not a direct copy of the data, it's what makes that interpolation happen when more than one fragment is generated by a vertex. If we wanted to have a direct copy without interpolation we could specify the flat keyword on the output here (eg: layout (location = 1) flat out vec3 frag_color; ). In that case, each fragment will use the vertex shader outputs of a particular vertex element (the spec calls it the " provoking index "). Since integer values can't be interpolated, you actually must specify flat with integers that pass between shader stages. pub const VERTEX_SOURCE: &str = "#version 450
layout (location = 0) in vec2 position;
layout (location = 1) in vec3 color; layout (location = 0) out gl_PerVertex { vec4 gl_Position;
};
layout (location = 1) out vec3 frag_color; void main()
{ gl_Position = vec4(position, 0.0, 1.0); frag_color = color;
}"; For our fragment shader, we accept a single input, with the exact same location as the output from the vertex shader. That's how the system knows to make them match. (In some older GLSL versions you also could match up variables by name, but SPIRV only goes by location.) This means that we actually don't have a location 0 input for our fragment shader, and that's totally fine. Our output is at location 0 (matching out SubpassDesc ) vec4 (which is "RGBA", since it'll be treated as a color). We'll sensibly call it color . We just promote the RGB color into an RGBA color by giving it an alpha of 1.0 ("fully opaque"). pub const FRAGMENT_SOURCE: &str = "#version 450
layout (location = 1) in vec3 frag_color; layout (location = 0) out vec4 color; void main()
{ color = vec4(frag_color,1.0);
}";
